import React from 'react';
import Categories from './Categories';
import Features from './Features';
import Review from './Reviews';
import Blogs from './Blogs';
import Banner from './Banner';
import '../css/Home.css'

const Home = () => {
    return (
        <>
            <Banner></Banner>
            <Features></Features>
            <Categories></Categories>
            <Review></Review>
            <Blogs></Blogs>
        </>
    )
}

export default Home;
